import { Box, List } from "@mui/material";
import React from "react";

const Sidebar = () => {
  return (
    <Box
      bgcolor="blueviolet"
      flex={1}
      p={2}
      sx={{ display: { xs: "none", sm: "block" } }}
    >
      Sidebar
      <List>
          <ListItem disablePadding>
            <ListItemButton>
              <ListItemIcon>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Inbox" />
            </ListItemButton>
          </ListItem>
          </List>
    </Box>
  );
};

export default Sidebar;
